import React from 'react';
import { useAuth0 } from '@auth0/auth0-react';

const LoginPage = () => {
  const { loginWithRedirect } = useAuth0();

  return (
    <div>
      <h1>Login Page</h1>
      <button onClick={() => loginWithRedirect()}>Log In with Auth0</button>
    </div>
  );
};

export default LoginPage;
